import React, { useState } from 'react'

const Box = (props) => {
    const [on, setOn] = useState(props.on)
    const style =
    {
        backroudColor : on ? "#222222" : '#000000',
        padding:5,
        border:"1px"
    }
    const toggle = () => {
        setOn(on => !on)
    }
  return (
    <div style={style} onClick={toggle}>Hello</div>
  )
}

export default Box
